import React from 'react';
import './TableProducts.scss'
import { useNavigate } from 'react-router-dom';



const TableProducts = ({products})=> {
    const navigate = useNavigate();

    const handleButtonClick = () => {
        navigate('/Movements');
    };
    return(
            <div className="products-table">
            <table>
                <thead>
                <tr>
                    <th>NÃºmero</th>
                    <th>Nombre</th>
                    <th>Marca</th>
                    <th>Detalle</th>
                    <th>Movimientos</th>
                </tr>
                </thead>
                {products.map((product, index) => (
                    <tr key={product.id}>
                    <td>{product.id}</td>
                    <td>{product.name}</td>
                    <td>{product.brand}</td>
                    <td><button className="details-btn">Ver detalle</button></td>
                    <td><button className="movements-btn" onClick={handleButtonClick}>Ver movimientos</button></td>
                    </tr>
                ))}
            </table>
            </div>
        )
}
export default TableProducts;
